import React from "react";

function Home() {
  return (
    <div className="home">
      <div 
				style={{
					backgroundColor: "#260841",
					minWidth: "100vw",
					minHeight: "100vh",
					position: "relative",
					overflow: "hidden"
				}}
			>
        <div 
          style={{ 
            marginLeft: "60px",
            marginRight: "60px"
          }}
        >

        </div>
      </div>
    </div>
  );
}

export default Home;
